import React from 'react';
import Header from './components/header';
import Homepage from './pages/homepage';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom'

function App() {
  return (
    <>
    <Router>
      <Header />
    <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/">
            <Homepage />
          </Route>
        </Switch>
    </Router>
    </>
  );
}

export default App;
